import React,{useState}from 'react';
import './nav.css'
import logo from './logo.png'
import {Link,animateScroll as scroll} from "react-scroll" 
import{BrowserRouter as Router, NavLink,Route}from 'react-router-dom'

function Nav() {
  const[showLinks,setShowLinks]= useState(false);

   
    return (
      
      <Router>
        
        <div className='navContainer'>
            <a href='/home'>
              <img src={logo} className='navLogo'alt='logo'></img></a> 
             <div className="links" id={showLinks ? "hidden" : ""}>
          <Link   
          activeClass="active"
          to="service"
          spy={true}
          smooth={true}
           duration={200}
           className="underline">
          Service
          </Link>
          <Link   
          activeClass="active"
          to="aboutus"
          spy={true}
          smooth={true}
          duration={200}
          className="underline">
          About Us
          </Link>
          <Link   
          activeClass="active"
          to="ourWork"
          spy={true}
          smooth={true}
           duration={200}
           className="underline">
         OurWork
          </Link>
     
          <Route path="/contact" component={contact}>Contact</Route>
        
         
           
             </div>
          <button onClick={()=>setShowLinks(!showLinks)} className='navMenu'>menu</button>
            </div>
            </Router>
            );
}

export default Nav;
